import React from "react"
import Heading from "./Heading"
import Footing from "./Footing"
import Note from "./Note"
import notes from "../notesCollection"

function CreateNote(props) {
    <Note
    key={props.key}
    title={props.title}
    content={props.content}
    />
}

function App() {
    return <div>
        <Heading />
        {notes.map(CreateNote)}
        <Footing />
    </div>
}

export default App
